import "./App.css";

function App() {
  return (
    <div className="App">
      <section className="section1">
        <p className="head">Ber3</p>
        <menu className="menu">
          <li>1</li>
          <li>2</li>
          <li>3</li>
        </menu>
      </section>
      <section className="section2"></section>

      <section className="section3"></section>
    </div>
  );
}

export default App;
